import React from 'react';
import './Auth.scss';
import Input from './Input';

class Auth extends React.Component {
    state = {
        login: "",
        password: ""
    }

    render() {
        return (
            <form className="auth-form">
                <Input label="Имя пользователя" name="login" />
                <Input label="Пароль" name="password" />
                <input type="submit" value="Войти" className="auth-button" />
            </form>
        )
    }
}

export default Auth;
